import React from 'react';

const ReservationComp = ({ reservation }) => {
    return (
        <div className="reservation">
            <h3>Reservation Details:</h3>
            <p>Check-in Date: {reservation.checkInDate}</p>
            <p>Check-out Date: {reservation.checkOutDate}</p>
            <p>Guest Name: {reservation.guestName}</p>
            <p>Number of Guests: {reservation.numberOfGuests}</p>
            <p>Booking Channel: {reservation.bookingChannel}</p>
        </div>
    );
}

export default ReservationComp;
